  false,\n\t\"url\": null,\n\t\"notes\": \"Dissolved Organic Matter, nutrients and
  CTD data are reported by Dennis Hansell of the Rosenstiel School of Marine & Atmospheric
  Science (RSMAS), University of Miami.nMethodology: none provided with data; see
  Li and Hansell (2008)nDMO note: the original data file included Type B (B indicates
  bottle sample) and bottom depth reported as 700 meters for all stations (the target
  depth of the casts); depth_n added to enable merge with bottle data. Parameter quality
  flags are integer values ranging from 0 through 8: 0 is very good; 1 is OK; 4 is
  questionable; 8 is bad.nPublication: Qian P. Li and Dennis A. Hansell. 2008. Nutrient
  distributions in baroclinic eddies of the oligotrophic North Atlantic and inferred
